import { Link } from 'react-router-dom'
import {useState} from 'react';
import Straydog from '../components/straydog/Straydog'
import StraydogGuide from '../components/straydog/StraydogGuide'
import StraydogSuccess from '../components/straydog/StraydogSuccess'
import StraydogFail from '../components/straydog/StraydogFail'
const Main = () => {
    const [page, setPage] = useState('main');
    let content = null; // 여기에 메인 페이지
    console.log(page)

    if(page === 'straydog') {
        content = <Straydog />
    } else if(page === 'straydog-guide') {
        content = <StraydogGuide />
    } else if(page === 'straydog-success') {
        content = <StraydogSuccess />
    } else if(page === 'straydog-fail') {
        content = <StraydogFail />
    }

    return (
        <div>
            <Link to ="/main"><h1>홈</h1></Link>
            <p>메인 페이지입니다.</p>
            <Link to ="/aboutus">소개</Link>
            <br/>
            <Link to ="/main/straydog" onClick={() => {
                setPage('straydog')
            }}>유기견</Link>
            <span> || </span>
            <Link to ="/main/straydog-guide" onClick={() => {
                setPage('straydog-guide')
            }}>입양가이드</Link>
            <span> || </span>
            <Link to ="/main/straydog-success" onClick={() => {
                setPage('straydog-success')
            }}>입양완료</Link>
            <span> || </span>
            <Link to ="/main/straydog-fail" onClick={() => {
                setPage('straydog-success')
            }}>추모</Link>
            <span> || </span>
            <Link to ="">우진</Link>
            <span> || </span>
            <Link to ="">연주</Link>
            <span> || </span>
            <Link to ="">예지</Link>
            <span> || </span>
            <Link to ="">정원</Link>
            <span> || </span>
            <Link to ="">수원</Link>
            <span> || </span>
            <Link to ="">태원</Link>
            <span> || </span>
            <hr/>
            {content}
            
        </div>
        
    );
};

export default Main;
